import React, { Component } from 'react';
import Arrow_Spinner from '../General/Arrow_Spinner';

class IntroSlides extends Component {
	render() {
		console.log(intro)
		return (
			<div id="introSlides">
				<div className="background"></div>
				<div className="text">
					<h5 className="tracking-in-expand-fwd-top">Who I am.</h5>
					<h1 className="tracking-in-expand-fwd-top">Frontend Developer. Psychologist. Entrepreneur.</h1>
				</div>
				<div className="image">
					<img className="image_sliding" src="/assets/images/Intro_3.jpg" alt="Profile_Picture" />
					<div className="image_control">
						<div className="image_control_text">
							<p>01</p>
							<p>/</p>
							<p>03</p>
						</div>
						<Arrow_Spinner time={this.props.time}/>
					</div>
				</div>
			</div>
		);
	}
}

export default IntroSlides;
